/***** START - Dynamic-Organic-Logo *****/
/**
     * Dynamic OC logo AB test
     * Removing logo on title is from property change fpp action
     */
    try{

        // Appending to icon to the thumbnial
        function appandIconToItem (iconURL,itemOverlayCollection,iconRatio,position){
            try{
                for (var i = 0; i < itemOverlayCollection.length ; i++) {
                    var itemOverlay =  itemOverlayCollection[i];
                    itemOverlay.style.backgroundImage = 'url(' + iconURL + ')';
                    itemOverlay.style.width = iconRatio + '%';
                    itemOverlay.style.backgroundSize = 'contain';
                    itemOverlay.style.paddingTop = iconRatio + '%';

                    if(TRCImpl && TRCImpl.direction === 'rtl'){
                        itemOverlay.style.right = '10px';
                    }
                    else {
                        itemOverlay.style.left = '10px';
                    }
                    if(position === 'top'){
                        itemOverlay.style.top = '10px';
                    }
                    else {
                        itemOverlay.style.bottom = '10px';
                    }
                }
            }
            catch (e) {
                __trcError('Error in appandIconToItem, which inside after-card-created (organic logo AB test) ',e.message);
            }
        }

        // variables
        var ITEMS_RATIO_1 = 6,
            ITEMS_RATIO_2 = 9,
            ITEMS_RATIO_3 = 12,
            DEFAULT_RATIO = ITEMS_RATIO_2;
            trcManager = this,
            trcRbox = TRCImpl.boxes[id],
            options=  trcRbox && trcRbox.parentFeed && trcRbox.parentFeed.options;

        // MAIN LOGIC
        if( options && options.feedDynamicParameters &&
            options.feedDynamicParameters.logo_location &&
            trcRbox && trcRbox.mode_name.indexOf('organic') > -1){

            var publisherLogoURL = trcManager.getPublisherVersionPropertyWithFallbackToNetwork('publisher-logo'),
                feedDynamicParameters = options.feedDynamicParameters,
                logoLocationObj = JSON.parse(feedDynamicParameters.logo_location),
                logoLocation = logoLocationObj.location,
                currentContainer = trcRbox.container,
                collectionOfThumbnailsOverlays = currentContainer.getElementsByClassName('thumbnail-overlay'),
                mode_name = trcRbox.mode_name;

            // calculated logo only if wasn't calculated
            // making sure that the content of the mode exists
            var numberOfItems = trcRbox.boxes.length,
                iconRatio;

            switch (numberOfItems) {
                case 0:
                    return;
                case 1:
                    iconRatio = ITEMS_RATIO_1;
                    break;
                // not taking in consideration 2 rows & 1 item
                case 2:
                    iconRatio = ITEMS_RATIO_2;
                    break;
                // not taking in consideration 3 rows & 1 item
                case 3:
                    iconRatio = ITEMS_RATIO_3;
                    break;
                default:
                    iconRatio = DEFAULT_RATIO;
            }

            // appending the logo
            appandIconToItem(publisherLogoURL, collectionOfThumbnailsOverlays, iconRatio, logoLocation);

        }
    }
    catch (e) {
        __trcError('Error in  publisher end - OC logo AB Test: ',e.message);
    }
